    '1. A sudden and inexplicable surge in the popularity of investing in companies that make fidget spinners. Investors will flock to these companies, convinced that they are the next big thing, despite the fact that fidget spinners were a passing fad that went out of style years ago. The market will be flooded with subpar fidget spinner startups, all vying for a piece of the increasingly crowded and oversaturated fidget spinner market.\n\n2. A dramatic increase in the number of VC firms claiming to have "disruptive" investment strategies, despite the fact that the vast majority of them are just investing in the same old tech companies. These firms will use buzzwords like "innovation" and "disruption" to try and make themselves sound more exciting and cutting-edge, even though they are actually just following the same tired investment strategies as everyone else. Investors will be duped by the hype and end up pouring money into mediocre companies that offer nothing new or original.\n\n3. An explosion of new "unicorn" startups, all of which are essentially just clones of existing successful companies but with a slightly different color scheme. The market will be flooded with these copycat companies, all claiming to be the next big thing and vying for investor attention. However, upon closer inspection, it will become clear that these companies offer nothing new or unique, and are simply trying to capitalize on the success of their predecessors without actually offering any real value.\n\n4. A rash of VC firms rebranding themselves as "innovation labs" or "accelerators" in order to sound more trendy and cutting-edge. These firms will change their names and marketing materials to try and appeal to the latest trends, even though their actual investment strategies remain the same. Investors will be duped by the flashy branding and fall for the hype, only to later realize that they have been taken for a ride.\n\n5. A proliferation of investment pitches featuring flashy Powerpoint presentations and buzzwords like "blockchain," "AI," and "machine learning," despite the fact that the companies making these pitches have no actual product or viable business plan. The VC world will be inundated with these flashy pitches, which will use impressive-sounding jargon and buzzwords to try and impress investors. However, upon closer examination, it will become clear that these companies have nothing substantial to offer, and are simply trying to ride the wave of hype surrounding certain buzzwords without actually having any real substance to back it up.',
  "0-1-0-2-1":
    "1. \ud83e\udd11VC firms will continue to throw money at any idea with a vague semblance of profitability, no matter how absurd or unsustainable. Investors will prioritize buzzwords and flashy presentations over thorough due diligence, leading to even more disastrous investments.\n2. \ud83e\udd21More and more VCs will become obsessed with funding AI-based startups, even though the vast majority of them will never see a return on investment. Despite numerous warnings from experts and skeptics, the hype surrounding AI will only continue to grow, luring in naive and overly optimistic investors.\n3. \ud83e\udd26\u200d Investors will continue to be surprised and outraged when startups they poured millions into inevitably fail, despite countless warning signs. Despite the numerous high-profile failures and scandals in the VC sector, investors will continue to blindly chase the next big thing, fueled by greed and FOMO.\n4. \ud83d\ude34The VC sector will continue to be plagued by a lack of diversity and inclusivity. The overwhelming majority of investors will continue to be wealthy, straight, white men, leading to a homogenous and short-sighted investment landscape.\n5. \ud83e\udd2eThe obsession with short-term gains and quick exits will continue to undermine the long-term health and sustainability of the VC sector. Rather than supporting and nurturing promising startups, investors will prioritize getting in and out as quickly as possible, leading to a cycle of boom and bust.",
  "0-1-0-2-2":
    "1. The rise of the \ud83e\udd84-funded startups, where unicorns are not only the investors but also the main product.\n2. The emergence of the \ud83c\udf2a\ufe0f-style investing, where investors only put their money in companies that have the potential to disrupt entire industries in a matter of minutes.\n3. The proliferation of the \ud83c\udfa9\ud83d\udc51 mentality, where investors prioritize style over substance and only invest in companies with flashy presentations and grandiose promises.\n4. The boom of the \ud83d\udca9-tech sector, where companies that solve the most mundane and insignificant problems receive millions in funding.\n5. The advent of the \ud83d\udc09-backed VC firms, where mythical creatures become the main source of funding and investment decisions are made based on ancient prophecies and arcane knowledge.",
