    '1. "The gold of venture capital shall pour forth like a river, flowing into the lands of startups far and wide, bringing prosperity to all who seek its aid."\n2. "The sagacious investors of the VC realm shall discern the most promising ventures with keen eyes and sound judgment, reaping great rewards for their foresight."\n3. "The bonds of partnership between venture capital firms and startups shall grow stronger, as both sides work together towards mutual success and prosperity."\n4. "The realm of technology shall continue to expand and innovate, offering new and exciting opportunities for investment and growth."\n5. "The use of data and analytics in the venture capital industry shall increase, allowing for more informed and strategic investment decisions."',
  "0-2-1-0-1":
    '1. \ud83c\udf1f "The sun of venture capital shall rise higher and brighter than ever before, illuminating the path to success for all who seek its warmth and light."\n2. \ud83c\udf08 "The rainbow of diversity in the VC sector shall spread its colorful wings, bringing new and varied perspectives to the table and fostering a more inclusive and innovative industry."\n3. \ud83c\udf31 "The seeds of collaboration between venture capital firms and startups shall take root and flourish, yielding a bountiful harvest of mutual growth and prosperity."\n4. \ud83c\udf93 "The scholars of the venture capital world shall continue to hone their skills and knowledge, staying at the forefront of the industry and leading the way to the future."\n5. \ud83d\ude80 "The rockets of innovation in the tech sector shall continue to soar, propelling the venture capital industry to new heights and providing endless opportunities for investment and growth."',
